import { Link } from 'react-router-dom';
import ProductCard from './productCard';

function getProducts(){
    fetch('https://Localhost:3000/api/productos')
    .then(response => response.json())
    .then(json => console.log(json))
}

class ListProducts extends Component {
    render () {
      return (
        <div className="App">
            <segment className="BackColor">
                <h1>Productos Online!! ^-^</h1>
                <br/>

                <ProductCard source={"https://www.10wallpaper.com/wallpaper/medium/1803/Bentley_Continental_GT_2018_4K_HD_medium.jpg"}/>

            </segment>
        </div>
      )
    }
  }
   
  export default ListProducts
